import React from 'react'
import './styles.css'

import Navbar from '../../ui/Navbar'

export default function Contact() {
  return(
    <div className="container-contact" id="contact">
      <Navbar />
      <h1>Contact</h1>
      <h3>Feel free to send us an e-mail or get in touch </h3>
    </div>
  )
}
